import React from "react";

export default function FilterNames(props) {
  const sortedNames = props.names.sort((a, b) => {
    let fa = a.name;
    let fb = b.name;

    if (fa < fb) {
      return -1;
    }
    if (fa > fb) {
      return 1;
    }
    return 0;
  });
  return filteredNames = sortedNames
    .filter((babyName) =>
      babyName.name.toUpperCase().includes(searchInput.toUpperCase())
    )
    .map((baby) =>
      baby.sex === "m" ? (
        <span className="babyBoy">{baby.name}</span>
      ) : (
        <span className="babyGirl">{baby.name}</span>
      )
    );
  return <div className="listOfNames">{filteredNames}</div>;
}
